import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeLayer, setActiveLayer] = useState(0);
  const [hoveredNode, setHoveredNode] = useState(null);

  // Simulate model processing
  useEffect(() => {
    const timer = setInterval(() => {
      setActiveLayer(prev => (prev < 5 ? prev + 1 : 0));
    }, 2000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="visual-container" style={{
      position: 'relative',
      width: '600px',
      height: '600px',
      perspective: '1000px',
    }}>
      {/* 3D Transformer Architecture */}
      <div style={{
        position: 'relative',
        width: '100%',
        height: '100%',
        transform: 'rotateX(60deg) rotateZ(-45deg)',
        transformStyle: 'preserve-3d',
      }}>
        {/* Transformer Layers */}
        {[0, 1, 2, 3, 4, 5].map((layer) => (
          <div
            key={layer}
            style={{
              position: 'absolute',
              top: `${50 + layer * 40}px`,
              left: '50%',
              transform: 'translateX(-50%)',
              width: '300px',
              height: '60px',
              backgroundColor: layer === activeLayer ? 
                'rgba(147, 197, 253, 0.2)' : 
                'rgba(147, 197, 253, 0.1)',
              borderRadius: '12px',
              border: '1px solid rgba(147, 197, 253, 0.3)',
              boxShadow: layer === activeLayer ?
                '0 0 30px rgba(147, 197, 253, 0.3)' :
                'none',
              transition: 'all 0.3s ease',
            }}
          >
            {/* Attention Heads */}
            <div style={{
              display: 'flex',
              justifyContent: 'space-around',
              alignItems: 'center',
              height: '100%',
              padding: '0 20px',
            }}>
              {[0, 1, 2, 3].map((head) => (
                <div
                  key={head}
                  style={{
                    width: '40px',
                    height: '40px',
                    backgroundColor: 'rgba(147, 197, 253, 0.15)',
                    borderRadius: '50%',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    animation: layer === activeLayer ?
                      `pulse 2s infinite ${head * 0.2}s` : 'none',
                  }}
                >
                  <div style={{
                    width: '20px',
                    height: '20px',
                    borderRadius: '50%',
                    backgroundColor: '#93C5FD',
                    opacity: layer === activeLayer ? 0.8 : 0.4,
                  }} />
                </div>
              ))}
            </div>
          </div>
        ))}

        {/* Attention Lines */}
        <svg style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          pointerEvents: 'none',
        }}>
          {activeLayer > 0 && Array.from({ length: 6 }).map((_, i) => (
            <line
              key={i}
              x1={`${30 + Math.random() * 40}%`}
              y1={`${(activeLayer * 10) + Math.random() * 10}%`}
              x2={`${50 + Math.random() * 40}%`}
              y2={`${(activeLayer * 10 + 10) + Math.random() * 10}%`}
              stroke="#93C5FD"
              strokeWidth="1"
              strokeDasharray="4"
              strokeOpacity="0.3"
            >
              <animate
                attributeName="strokeOpacity"
                values="0.3;0.8;0.3"
                dur="2s"
                repeatCount="indefinite"
              />
            </line>
          ))}
        </svg>

        {/* Token Embeddings */}
        <div style={{
          position: 'absolute',
          top: '20px',
          left: '50%',
          transform: 'translateX(-50%)',
          display: 'flex',
          gap: '10px',
        }}>
          {['Input', 'Embed', 'Process', 'Output'].map((stage, index) => (
            <div
              key={stage}
              style={{
                padding: '8px 16px',
                backgroundColor: index <= activeLayer ? 
                  'rgba(147, 197, 253, 0.2)' : 
                  'rgba(147, 197, 253, 0.1)',
                borderRadius: '20px',
                color: '#93C5FD',
                fontSize: '14px',
                animation: index === activeLayer ?
                  'glow 2s infinite' : 'none',
              }}
            >
              {stage}
            </div>
          ))}
        </div>

        {/* Processing Indicators */}
        <div style={{
          position: 'absolute',
          bottom: '20px',
          left: '50%',
          transform: 'translateX(-50%)',
          display: 'flex',
          gap: '20px',
        }}>
          {[
            { label: 'Tokens', value: '2048' },
            { label: 'Heads', value: '96' },
            { label: 'Dim', value: '12288' },
          ].map((stat) => (
            <div
              key={stat.label}
              style={{
                backgroundColor: 'rgba(147, 197, 253, 0.1)',
                padding: '8px 12px',
                borderRadius: '8px',
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
              }}
            >
              <span style={{ color: '#93C5FD', fontSize: '12px' }}>
                {stat.label}
              </span>
              <span style={{ color: '#FFFFFF', fontSize: '14px' }}>
                {stat.value}
              </span>
            </div>
          ))}
        </div>

        {/* Energy Flow Particles */}
        {Array.from({ length: 20 }).map((_, i) => (
          <div
            key={i}
            style={{
              position: 'absolute',
              width: '4px',
              height: '4px',
              backgroundColor: '#93C5FD',
              borderRadius: '50%',
              left: `${Math.random() * 100}%`,
              top: `${Math.random() * 100}%`,
              opacity: 0.5,
              animation: `
                particle ${3 + Math.random() * 2}s infinite linear ${Math.random() * 2}s,
                glow 2s infinite ease-in-out ${Math.random()}s
              `,
            }}
          />
        ))}
      </div>
    </div>
  );
}

export default AIVisual;
